// Solution 1:
const freqAlphabets = (s) => {
    let result = [];
    for(let i=0;i<s.length;i++){
        if(s[i] === '#'){
            const num = Number(s.slice(i-2, i));
            result.splice(num - 1, 0, s[i-3]);
            i += 2;
        } else {
            result.push(s[i]);
        }
    }
    return result.join('');
}

// Solution 2:
const freqAlphabets = (s) => {
    let result = '';
    while(s.length > 0){
        if(s[0] === '#'){
            const num = Number(s.slice(0, 2));
            result += String.fromCharCode(96 + num);
            s = s.slice(3);
        } else {
            result += String.fromCharCode(97 + parseInt(s[0]));
            s = s.slice(1);
        }
    }
    return result;
}
